import Link from "next/link";
import Burger from './Burger'




const Navbar = () =>(
    <div className="navbar">

        <div className ="logo">
            <Link href="/"><img className="logoimg" src="/logo.png" alt="Robert"></img></Link>
        </div>
        <Burger/>

</div>

)

export default Navbar;

